typedef struct
{
    TABProjInfo sProj;          /* Projection/datum definition */
    double      dXMin;          /* Default bounds for that coordsys */
    double      dYMin;
    double      dXMax;
    double      dYMax;
} MapInfoBoundsInfo;

typedef struct
{
    TABProjInfo       sProjIn;
    MapInfoBoundsInfo sBoundsInfo;
} MapInfoRemapProjInfo;

